import React from "react";
import {Switch, Redirect, BrowserRouter, Router} from 'react-router-dom'
import Layout from './Layout'

function App() {
    return(
        <BrowserRouter>
        <Switch>
            <Layout>
                <Router exact path="/" component={homepage}/>
                <Redirect from="*" to="/"/>
            </Layout>
        </Switch>
        </BrowserRouter>
    )
}

export default App;
